window.bookSummaryJSON = "<p>A forgotten chamber secreted beneath a river. </p> <p>An ancient evil that lies slumbering in the dark. </p> <p>A guardian determined to fulfill his duty to his last, dying breath. </p> <p>As something dark and deadly takes to the skies over Harrington Falls, Jake Caruso and his friends, Sam Travers and Katelynn Riley, find themselves drawn into a primeval conflict set in motion centuries before. When fresh blood is spilled and the death toll mounts, these three friends will find themselves faced with a terror beyond imagination, one that will require every vestige of their strength, faith, and determination to confront.</p>"; 
